import React from "react";
import "./App.css";
import Header from "./components/Header";
import Navbar from "./components/Navbar";
import Profile from "./components/Profile";
import Footer from "./components"

const App = () => {
  return (
    <div className="socialNetwork">
      <Header />
      <Navbar />
      <Profile />
      <Footer />
    </div>
  );
};

export default App;
